import {BrowserRouter, Switch, Route, Link} from 'react-router-dom';
import './App.css';
import Homepage from './screens/Homepage'
import BuyerLogin from './screens/BuyerLogin'

function App() {



  return (
    <div className="App">
      <BrowserRouter>
        <Route path="/">
          <Homepage />
        </Route>
        <Route path="/buyer">
          <BuyerLogin />
        </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
